                    sp = sp[1].split('&')
                    for (let j = 0; j < sp.length; j++) {

                        }
                    }
                    if (result) {
                        break

                }
            }
            return result

            var sp = document.cookie.split(';')
            var result = []

                if (sp2.length > 1) {
                    if (sp2[1] == 'k100_visited') {
                        result.push(sp2[0])
                    }
                }
            }
